import React , {Fragment} from 'react';

const Raid = (props) => {

  if(!props.raid){
    return "Loading...";
  }


  return (
    <div className="component">
        <p className="name">
          {props.raid.location}
        </p>
      <p>Loot: {props.raid.loot}</p>
    </div>
  )
}

export default Raid;
